// -------------------- Import --------------------
import React, { Component } from "react";
import { NavLink } from "react-router-dom";
import nba_logo from "../../Assets/Icons/nba_logo.png";

// -------------------- Main Bar --------------------
export default class MainBar extends Component {
  render() {
    return (
      <header className="main_bar">
       
        {/* Logo */}
        <img src={nba_logo} alt="" className="nba_logo" />
        {/* Players */}
        <NavLink to="/Players">
          <div>PLAYERS</div>
        </NavLink>
        {/* Teams */}
        <NavLink to="/Teams">
          <span>TEAMS</span>
        </NavLink>
      </header>
    );
  }
}
